import React, { Component } from 'react'

 class Login extends Component {
    constructor(props){
        super();
        this.state={
            username :"",
            password :""
        }
    }
    render() {
        return (
            <div>
                <h1> Login page</h1>
                <label>Username</label>
                <input type = "username"/>
                <br/> <br/>
                <label>password</label>
                <input type="password"/>
                <br/><br/>
                <button>Login</button>
                <button>clear</button>
            </div>
        )
    }
}
export default Login;
